import { Pressable, Text } from "react-native";

import { styles } from './style';

interface login {
    placeholder: string,
}

export default function ButtonLogin(props: login) {
    return (
        <Pressable style={styles.content}>
            <Text style={styles.content} className="text-center">Hello</Text>
        </Pressable>
    )
}
